import './product.css'
import 'bootstrap/dist/css/bootstrap.min.css';

import {Navbar,NavDropdown,Form,FormControl,Button,Nav,thumbnail,Table,Image} from 'react-bootstrap';




class product extends React.Component {



  render() {

    return (
        <>
        <Button className='add' size="lg" variant="danger">Add new product</Button> 
        <Table striped bordered hover size="sm">

        <tbody>
          <tr>

            <td><Image className="img_order" src={require('../Image/image.jpg')}  rounded /></td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>

            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>

            <td colSpan="2">Larry the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </Table>
      </>
    );
  }
}

export default product;
